function mint(
  string memory ctkTxHash,
  address account,
  uint256 amount
) public onlyOperator returns (bool) {
  require(
    bytes(ctkTxHash).length != 0,
    "BEP20: transaction hash should not be empty"
  );
  string memory uppercaseTxHash = _toUpper(ctkTxHash);
  require(_ctkTxMap[uppercaseTxHash] == 0, "BEP20: transaction hash exists");
  require(
    _operatorQuota[msg.sender] >= amount,
    "operator quota is insufficient, please rotate operator key"
  );

  _operatorQuota[msg.sender] -= amount;
  _ctkTxMap[uppercaseTxHash] = amount;
  _mint(account, amount);

  return true;
}

